import { GoogleMap, MarkerF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

const center = {
  lat: 23.3441,
  lng: 85.3096,
};

// Define coordinates for 10 uneven polygons (P1 to P10) that touch but do not overlap
const districtCoords = [
  [ // P1
    { lat: 23.460, lng: 85.260 },
    { lat: 23.470, lng: 85.260 },
    { lat: 23.465, lng: 85.270 },
    { lat: 23.460, lng: 85.270 },
  ],
  [ // P2
    { lat: 23.470, lng: 85.260 },
    { lat: 23.480, lng: 85.270 },
    { lat: 23.475, lng: 85.280 },
    { lat: 23.470, lng: 85.280 },
  ],
  [ // P3
    { lat: 23.460, lng: 85.270 },
    { lat: 23.470, lng: 85.270 },
    { lat: 23.475, lng: 85.290 },
    { lat: 23.460, lng: 85.290 },
  ],
  [ // P4
    { lat: 23.460, lng: 85.290 },
    { lat: 23.470, lng: 85.290 },
    { lat: 23.475, lng: 85.300 },
    { lat: 23.460, lng: 85.300 },
  ],
  [ // P5
    { lat: 23.470, lng: 85.290 },
    { lat: 23.480, lng: 85.290 },
    { lat: 23.485, lng: 85.310 },
    { lat: 23.470, lng: 85.310 },
  ],
  [ // P6
    { lat: 23.480, lng: 85.290 },
    { lat: 23.490, lng: 85.280 },
    { lat: 23.485, lng: 85.300 },
    { lat: 23.480, lng: 85.300 },
  ],
  [ // P7
    { lat: 23.460, lng: 85.310 },
    { lat: 23.470, lng: 85.310 },
    { lat: 23.465, lng: 85.320 },
    { lat: 23.460, lng: 85.320 },
  ],
  [ // P8
    { lat: 23.470, lng: 85.300 },
    { lat: 23.480, lng: 85.300 },
    { lat: 23.485, lng: 85.320 },
    { lat: 23.470, lng: 85.320 },
  ],
  [ // P9
    { lat: 23.460, lng: 85.320 },
    { lat: 23.470, lng: 85.320 },
    { lat: 23.465, lng: 85.330 },
    { lat: 23.460, lng: 85.330 },
  ],
  [ // P10
    { lat: 23.470, lng: 85.310 },
    { lat: 23.480, lng: 85.310 },
    { lat: 23.485, lng: 85.330 },
    { lat: 23.470, lng: 85.330 },
  ],
];

// Icon positions for each polygon
const iconCoordinates = {
    P123: { lat: 23.465, lng: 85.285 },
    P232: { lat: 23.465, lng: 85.315 },
    P365: { lat: 23.465, lng: 85.345 },
    P423: { lat: 23.475, lng: 85.275 },
    P512: { lat: 23.475, lng: 85.305 },
    P6332: { lat: 23.475, lng: 85.335 },
    P7334: { lat: 23.465, lng: 85.365 },
    P8234: { lat: 23.465, lng: 85.385 },
    P9243: { lat: 23.455, lng: 85.280 },
    P2323: { lat: 23.455, lng: 85.300 },
};

// URL for the icons to be used in each polygon (placeholder URLs)
const iconUrls = {
    P1: "location_on", // Material Icons name
  P2: "store",
  P3: "restaurant",
  P4: "local_hospital",
  P5: "school",
  P6: "shopping_cart",
  P7: "local_parking",
  P8: "business",
  P9: "place",
  P10: "account_balance",
};

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={15}>
      {/* Loop through districtCoords and create Polygons */}
      {districtCoords.map((coords, index) => (
        <PolygonF
          key={index}
          paths={coords}
          options={{
            fillColor: ['#FF0000', '#00FF00', '#0000FF', '#FFFF00', '#FFA500', '#800080', '#008080', '#FFC0CB', '#808080', '#A52A2A'][index],
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      ))}

      {/* Loop through iconCoordinates and add Icons */}
      {Object.entries(iconCoordinates).map(([key, position]) => (
        <MarkerF
          key={key}
          position={position}
          icon={{
            url: iconUrls[key], // Use the corresponding icon for each polygon
            scaledSize: new window.google.maps.Size(32, 32), // Adjust size
          }}
          label={{
            text: key, // Display P1, P2, etc.
            fontSize: '12px',
            color: 'white',
          }}
        />
      ))}
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
